let base64sample = '';

((_ => document.readyState == 'loading' ? window.addEventListener('DOMContentLoaded', _) : _())(
    _ => {

        function base64ToImage() {


            _c.errors_block.classList.add('d-none');
            _c.results_block.classList.add('d-none');

            _c.main_action_btn.classList.add('disabled');

            let image_type = 'png';
            let base64code = _c.input_text.value;

            if (base64code != '' && base64code.trim() != '') {

                base64code = "data:image/" + image_type + ";base64," + base64code;

                _c.results_block.classList.remove('d-none');


                _c.save_result_in_file.setAttribute('href', base64code);
                _c.save_result_in_file.setAttribute('download', SLUG + '.' + image_type);
                _c.result_elem.setAttribute('src', base64code);


            } else {
                _c.errors_block.classList.remove('d-none');
            }
            _c.main_action_btn.classList.remove('disabled');
        }

        let _c = _$.elemSelector(['#load_sample', '#refresh_tool', '#copy_input_text', '#delete_input', '#input_text', '#auto', '#main_action_btn', '#upload_file', '#input_file', '#copy_result', '#save_result_in_file', '#letter_count', '#results_block', '#errors_block', '#result_elem', '#errors_text']);

        _c.main_action_btn.addEventListener('click', base64ToImage);

        _c.input_text.addEventListener('input', _ => _c.auto.checked ? base64ToImage() : '');

        _c.copy_input_text.addEventListener('click', _ => _$.copyToClipboard(_c.input_text.value).then(_r => _r ? _$.makeToasts('success', { 'body': 'Input Text Successfully Copied' }) : _$.makeToasts('error', { 'body': 'Unable to Copy' })));


        _c.copy_result.addEventListener('click', _ => _$.copyToClipboard(new Image().src = _c.result_elem.getAttribute('src')).then(_r => _r ? _$.makeToasts('success', { 'body': 'Result Text Successfully Copied' }) : _$.makeToasts('error', { 'body': 'Unable to Copy' })));


        _c.delete_input.addEventListener('click', _ => {
            _c.result_text.value = '';
            _c.input_text.value = '';
            _$.makeToasts('danger', { 'body': 'Input Text Deleted' });
        });


        _c.refresh_tool.addEventListener('click', _$.refreshPage);

        _c.load_sample.addEventListener('click', _ => _c.input_text.value = base64sample);


        _c.upload_file.addEventListener('click', _ => _c.input_file.click());

        _c.input_file.addEventListener('click', _ => {
            _$.uploadFileData('input_file', _c.input_text);
        });

    }
));

